import React from 'react';
import { Routes, Route, Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const DashboardContainer = styled.div`
  min-height: 100vh;
  display: flex;
  background: ${props => props.theme.colors.background};
  color: ${props => props.theme.colors.text};
`;

const Sidebar = styled.div`
  width: 280px;
  background: ${props => props.theme.colors.surface};
  padding: 2rem;
  border-right: 1px solid ${props => props.theme.colors.border};
  display: flex;
  flex-direction: column;
  position: fixed;
  height: 100vh;
  overflow-y: auto;
  z-index: ${props => props.theme.zIndex.sidebar};

  @media (max-width: ${props => props.theme.breakpoints.md}) {
    width: 240px;
  }

  @media (max-width: ${props => props.theme.breakpoints.sm}) {
    transform: translateX(-100%);
    transition: transform 0.3s ease;

    &.open {
      transform: translateX(0);
    }
  }
`;

const MainContent = styled.div`
  flex: 1;
  padding: 2rem;
  margin-left: 280px;
  background: ${props => props.theme.colors.background};
  min-height: 100vh;

  @media (max-width: ${props => props.theme.breakpoints.md}) {
    margin-left: 240px;
    padding: 1.5rem;
  }

  @media (max-width: ${props => props.theme.breakpoints.sm}) {
    margin-left: 0;
    padding: 1rem;
  }
`;

const NavLink = styled(Link)`
  display: flex;
  align-items: center;
  padding: 0.75rem 1rem;
  color: ${props => props.active ? props.theme.colors.primary : props.theme.colors.text};
  text-decoration: none;
  border-radius: ${props => props.theme.borderRadius.small};
  margin-bottom: 0.5rem;
  transition: ${props => props.theme.transition.standard};
  background: ${props => props.active ? 'rgba(255, 77, 90, 0.1)' : 'transparent'};
  font-weight: ${props => props.active ? '600' : '400'};
  border-left: 3px solid ${props => props.active ? props.theme.colors.primary : 'transparent'};

  &:hover {
    background: ${props => props.theme.colors.hover};
    transform: translateX(3px);
  }
`;

const LogoutButton = styled.button`
  width: 100%;
  padding: 0.75rem 1rem;
  background: ${props => props.theme.colors.error};
  color: white;
  border: none;
  border-radius: ${props => props.theme.borderRadius.small};
  cursor: pointer;
  margin-top: auto;
  transition: ${props => props.theme.transition.standard};
  font-weight: 500;
  display: flex;
  align-items: center;
  justify-content: center;

  &:hover {
    background: ${props => props.theme.colors.errorDark};
  }
`;

const DashboardHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
  padding-bottom: 1rem;
  border-bottom: 1px solid ${props => props.theme.colors.border};
`;

const DashboardTitle = styled.h1`
  color: ${props => props.theme.colors.text};
  font-size: 1.75rem;
  font-weight: 700;
  margin: 0;

  span {
    color: ${props => props.theme.colors.primary};
  }
`;

const AdminCard = styled(motion.div)`
  background: ${props => props.theme.colors.surface};
  border-radius: ${props => props.theme.borderRadius.medium};
  padding: 1.5rem;
  margin-bottom: 1.5rem;
  box-shadow: ${props => props.theme.shadows.medium};
  border: 1px solid ${props => props.theme.colors.border};
`;

const CardTitle = styled.h2`
  color: ${props => props.theme.colors.text};
  font-size: 1.25rem;
  margin-top: 0;
  margin-bottom: 1rem;
  border-bottom: 1px solid ${props => props.theme.colors.border};
  padding-bottom: 0.75rem;
`;

const AdminDashboard = () => {
  const { logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const currentPath = location.pathname.split('/').pop();

  const handleLogout = () => {
    logout();
    navigate('/admin/login');
  };

  // Animation variants
  const cardVariants = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0, transition: { duration: 0.3 } }
  };

  return (
    <DashboardContainer>
      <Sidebar>
        <DashboardTitle>Tech<span>Veda</span></DashboardTitle>
        <nav style={{ marginTop: '2rem' }}>
          <NavLink to="/admin/dashboard" active={currentPath === 'dashboard' || currentPath === 'admin'}>
            Dashboard
          </NavLink>
          <NavLink to="/admin/projects" active={currentPath === 'projects'}>
            Projects
          </NavLink>
          <NavLink to="/admin/services" active={currentPath === 'services'}>
            Services
          </NavLink>
          <NavLink to="/admin/about" active={currentPath === 'about'}>
            About
          </NavLink>
          <NavLink to="/admin/contact" active={currentPath === 'contact'}>
            Contact
          </NavLink>
        </nav>
        <LogoutButton onClick={handleLogout}>Logout</LogoutButton>
      </Sidebar>

      <MainContent>
        <Routes>
          <Route path="/" element={
            <div>
              <DashboardHeader>
                <DashboardTitle>Dashboard <span>Overview</span></DashboardTitle>
              </DashboardHeader>
              <AdminCard
                variants={cardVariants}
                initial="initial"
                animate="animate"
              >
                <CardTitle>Welcome to Admin Panel</CardTitle>
                <p>Manage your website content from this dashboard.</p>
              </AdminCard>
            </div>
          } />
          <Route path="/projects" element={
            <div>
              <DashboardHeader>
                <DashboardTitle>Projects <span>Management</span></DashboardTitle>
              </DashboardHeader>
              <AdminCard
                variants={cardVariants}
                initial="initial"
                animate="animate"
              >
                <CardTitle>Projects</CardTitle>
                <p>Manage your portfolio projects here.</p>
              </AdminCard>
            </div>
          } />
          <Route path="/services" element={
            <div>
              <DashboardHeader>
                <DashboardTitle>Services <span>Management</span></DashboardTitle>
              </DashboardHeader>
              <AdminCard
                variants={cardVariants}
                initial="initial"
                animate="animate"
              >
                <CardTitle>Services</CardTitle>
                <p>Manage your services information here.</p>
              </AdminCard>
            </div>
          } />
          <Route path="/about" element={
            <div>
              <DashboardHeader>
                <DashboardTitle>About <span>Page Editor</span></DashboardTitle>
              </DashboardHeader>
              <AdminCard
                variants={cardVariants}
                initial="initial"
                animate="animate"
              >
                <CardTitle>About</CardTitle>
                <p>Update your about page content here.</p>
              </AdminCard>
            </div>
          } />
          <Route path="/contact" element={
            <div>
              <DashboardHeader>
                <DashboardTitle>Contact <span>Information</span></DashboardTitle>
              </DashboardHeader>
              <AdminCard
                variants={cardVariants}
                initial="initial"
                animate="animate"
              >
                <CardTitle>Contact</CardTitle>
                <p>Manage contact details and form submissions.</p>
              </AdminCard>
            </div>
